INSERT INTO documents_editables (`documentId`,`name`,`type`,`data`) VALUES (95,'content:2.content','wysiwyg','<h6>Gift Product</h6>\n\n<p>Add&nbsp;<a href=\"/en/shop/Products/Cars/Economy-Cars/Citroen-2CV~p75\" pimcore_id=\"75\" pimcore_type=\"object\">a red Citroen 2CV</a>&nbsp;or&nbsp;<a href=\"/en/shop/Products/Cars/Economy-Cars/Citroen-2CV~p74\" pimcore_id=\"74\" pimcore_type=\"object\">a yellow Citroen 2CV</a>&nbsp;to your cart and get <strong>a gift product</strong> for free.</p>\n\n<h6>Product Discount</h6>\n\n<p>For all products of&nbsp;<a href=\"/en/shop/Products/Spare-Parts/Steering-Wheels~c399?pimcore_editmode=true&amp;systemLocale=en&amp;_dc=1566742246367&amp;unminified_js=\" pimcore_id=\"399\" pimcore_type=\"object\">steering wheels category</a>&nbsp;get<strong> 15% product discount.&nbsp;</strong></p>\n\n<h6>Cart Discount</h6>\n\n<p>For all cart with amount bigger than EUR 30,000,- get <strong>3% cart discount.&nbsp;</strong></p>\n');
