INSERT INTO documents_editables (`documentId`,`name`,`type`,`data`) VALUES (110,'content:1.content','wysiwyg','<h6>Interessed-based Target Groups</h6>\n\n<ul>\n	<li>Luxury-Cars-Fan\n	<ul>\n		<li>Visit at least 5 pages in luxury car area</li>\n	</ul>\n	</li>\n	<li>Economy-Cars-Fan\n	<ul>\n		<li>Visit at least 5 pages in economy car area</li>\n	</ul>\n	</li>\n	<li>Sports-Cars-Fan\n	<ul>\n		<li>Visit at least 5 pages in sports car area</li>\n	</ul>\n	</li>\n</ul>\n');
