INSERT INTO documents_editables (`documentId`,`name`,`type`,`data`) VALUES (110,'content:3.content','wysiwyg','<h6>Sales based Target Groups</h6>\n\n<ul>\n	<li>New Customer\n	<ul>\n		<li>Place one order</li>\n	</ul>\n	</li>\n	<li>Regular Customer\n	<ul>\n		<li>Place more that one and less than 5 orders</li>\n	</ul>\n	</li>\n	<li>VIP Customer\n	<ul>\n		<li>Place more than 5 orders</li>\n	</ul>\n	</li>\n</ul>\n');
