INSERT INTO documents_editables (`documentId`,`name`,`type`,`data`) VALUES (110,'content:4.lead','wysiwyg','<p>For loggin-in customers following segments will be calculated (if profiling is allowed for customer).</p>\n');
INSERT INTO documents_editables (`documentId`,`name`,`type`,`data`) VALUES (110,'content:5.content','wysiwyg','<h6>Based on customer data</h6>\n\n<ul>\n	<li>Gender: female, male, not-set</li>\n	<li>State: based on ZIP defined in customer data</li>\n</ul>\n\n<h6>Based on customer behavior</h6>\n\n<ul>\n	<li>Interests: based on manufacturer, body-style and car-class of ordered products</li>\n	<li>VisitingCount: based on visits of user</li>\n</ul>\n\n<p>&nbsp;</p>\n');
