INSERT INTO documents_editables (`documentId`,`name`,`type`,`data`) VALUES (110,'content:8.content','wysiwyg','<h6>Manual Personalization</h6>\n\n<ul>\n	<li>Portal page hero slider personalized for target groups\n	<ul>\n		<li>Luxury-Cars-Fan</li>\n		<li>Economy-Cars-Fan</li>\n		<li>Sports-Cars-Fan</li>\n	</ul>\n	</li>\n</ul>\n\n<h6>Automatic Personalization</h6>\n\n<ul>\n	<li>Visit pages to collect segements to your visitor info\n	<ul>\n		<li>Manually tagged\n		<ul>\n			<li><a href=\"/en/Magazine/Pick%20of%20the%20Day\" pimcore_id=\"104\" pimcore_type=\"document\">Pick of the Day</a></li>\n			<li><a href=\"/en/More-Stuff/Landingpages/Chevrolet\" pimcore_id=\"54\" pimcore_type=\"document\">Chevrolet</a></li>\n			<li><a href=\"/en/More-Stuff/Landingpages/Ford-Musclecars\" pimcore_id=\"55\" pimcore_type=\"document\">Ford-Musclecars</a></li>\n			<li><a href=\"/en/More-Stuff/Landingpages/Vans\" pimcore_id=\"56\" pimcore_type=\"document\">Vans</a></li>\n			<li><a href=\"/en/More-Stuff/Landingpages/Volkswagen\" pimcore_id=\"57\" pimcore_type=\"document\">Volkswagen</a></li>\n		</ul>\n		</li>\n		<li>Automatically tagged\n		<ul>\n			<li>category pages like&nbsp;<a href=\"/en/shop/Products/Cars/Economy-Cars/City-Cars~c548?pimcore_editmode=true&amp;systemLocale=en&amp;_dc=1566895234726&amp;unminified_js=\" pimcore_id=\"548\" pimcore_type=\"object\">city cars</a>,&nbsp;<a href=\"/en/shop/Products/Cars/Economy-Cars/Economy-Cars~c561?pimcore_editmode=true&amp;systemLocale=en&amp;_dc=1566895234726&amp;unminified_js=\" pimcore_id=\"561\" pimcore_type=\"object\">economy cars</a>,&nbsp;<a href=\"/en/shop/Products/Cars/Economy-Cars/Family-Cars~c551?pimcore_editmode=true&amp;systemLocale=en&amp;_dc=1566895234726&amp;unminified_js=\" pimcore_id=\"551\" pimcore_type=\"object\">family cars</a>,&nbsp;<a href=\"/en/shop/Products/Cars/Luxury-Cars/Executive-Cars~c550?pimcore_editmode=true&amp;systemLocale=en&amp;_dc=1566895234726&amp;unminified_js=\" pimcore_id=\"550\" pimcore_type=\"object\">executive cars</a>, etc.</li>\n			<li>all product detail pages</li>\n		</ul>\n		</li>\n	</ul>\n	</li>\n	<li>Portal page product teaser row automatically personalized based on tracked interests\n	<ul>\n		<li>manufacturer</li>\n		<li>car class</li>\n	</ul>\n	</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n');
