INSERT INTO documents_editables (`documentId`,`name`,`type`,`data`) VALUES (194,'content:1.lead','wysiwyg','<p>In data objects and assets we have sample workflows configured.&nbsp;</p>\n');
INSERT INTO documents_editables (`documentId`,`name`,`type`,`data`) VALUES (194,'content:2.content','wysiwyg','<h6>Workflow on Assets</h6>\n\n<p>Just a simple sample workflow on assets. To see it, just open any asset in backend.&nbsp;</p>\n\n<h6>Workflow on Objects</h6>\n\n<p>A bit more complex workflow on data objects, just open a car object in /upload/new to see the workflow</p>\n\n<ul>\n	<li>multiple places</li>\n	<li>parallel workflow streams</li>\n	<li>custom layouts depending on workflow place</li>\n	<li>notifications are sent to admin user when \'mark product done\' transition is executed.&nbsp;</li>\n</ul>\n');
