INSERT INTO documents_editables (`documentId`,`name`,`type`,`data`) VALUES (195,'content:6.content','wysiwyg','<p><strong>Assets - Brand Logo Image</strong> (add&nbsp;more fields in query: mimetype, filesize)</p>\n\n<p><iframe frameborder=\"0\" scrolling=\"no\" src=\"/pimcore-datahub-webservices/explorer/assets?apikey=9e265983fbd2dc42b8f7cdb841c82807&amp;query=%7B%0A%20%20getAsset(id%3A%20311)%20%7B%0A%20%20%20%20filename%0A%20%20%20%20type%0A%20%20%20%20fullpath%0A%20%20%7D%0A%7D%0A\" style=\"width:100%; height: 500px\"></iframe></p>\n\n<p><a href=\"/pimcore-datahub-webservices/explorer/assets?apikey=9e265983fbd2dc42b8f7cdb841c82807&amp;query=%7B%0A%20%20getAsset(id%3A%20311)%20%7B%0A%20%20%20%20filename%0A%20%20%20%20type%0A%20%20%20%20fullpath%0A%20%20%7D%0A%7D%0A\" target=\"_blank\">Show full screen</a></p>\n');
INSERT INTO documents_editables (`documentId`,`name`,`type`,`data`) VALUES (195,'content:7.content','wysiwyg','<p>For a live example of content-as-a-service (CaaS) / headless CMS please have a look at the&nbsp;<a href=\"/en/Events\" rel=\"nofollow\">events page</a>. This page fetches the data from Pimcore backend via GraphQL with a Data Hub endpoint.</p>\n');
INSERT INTO documents_editables (`documentId`,`name`,`type`,`data`) VALUES (195,'content:8.content','wysiwyg','<p><strong>Mutation - Create&nbsp;Car Object</strong> (run query to create car object under folder \"/upload/new\")</p>\n\n<p><iframe frameborder=\"0\" scrolling=\"no\" src=\"/pimcore-datahub-webservices/explorer/products?apikey=6332aa5e6d3d6c0be31da2a8b3442113&amp;query=mutation%20%7B%0A%20%20createCar(parentId%3A%201086%2C%20key%3A%20&quot;Datahub-car-1&quot;%2C%20published%3A%20false%2C%0A%20%20input%3A%20%7B%0A%20%20%20%20name%3A%20&quot;Datahub-car-1&quot;%2C%0A%20%20%7D)%20%7B%0A%20%20%20%20success%0A%20%20%20%20message%0A%20%20%20%20output%20%7B%0A%20%20%20%20%20%20id%0A%20%20%20%20%20%20name%0A%20%20%20%20%7D%0A%20%20%7D%0A%7D%0A\" style=\"width:100%; height: 500px\"></iframe></p>\n\n<p><a href=\"/pimcore-datahub-webservices/explorer/products?apikey=9e265983fbd2dc42b8f7cdb841c82807&amp;query=%7B%0A%20%20getAsset(id%3A%20311)%20%7B%0A%20%20%20%20filename%0A%20%20%20%20type%0A%20%20%20%20fullpath%0A%20%20%7D%0A%7D%0A\" target=\"_blank\">Show full screen</a></p>\n');
